    astDescription: {
      type: "root",
      children: [
        {
          type: "p",
          children: [
            "Pending home sales in the US unexpectedly expanded year over year last month while sharply outpacing views on a sequential basis, the National Association of Realtors said Friday. ",
          ],
        },
        {
          type: "p",
          children: [
            "The forward-looking indicator of home sales based on contract signings rose by 1.3% in December from the same period of 2022. Analysts were modeling for a decline of 4.1%, according to a Bloomberg consensus poll. From November, pending home sales climbed 8.3% to 77.3, exceeding the forecast for 2% growth. ",
          ],
        },
        {
          type: "p",
          children: [
            '"The housing market is off to a good start this year, as consumers benefit from falling mortgage rates and stable home prices," said NAR Chief Economist Lawrence Yun. "Job additions and income growth will further help with housing affordability, but increased supply will be essential to satisfying all potential demand."',
          ],
        },
        {
          type: "p",
          children: [
            "From the same period last year, sales were up in all regions, except the Northeast, according to the NAR. On a monthly basis, they surged 14% in the West and nearly 12% in the South. ",
          ],
        },
        {
          type: "p",
          children: [
            "For 2024, the association predicts that existing-home sales will climb 13% year over year to 4.62 million units. It then sees sales rallying nearly 16% in 2025. Existing home sales unexpectedly dropped by 1% on a sequential basis in December, NAR reported earlier this month. Yun said at the time that December's decline appeared to be the cycle bottom. ",
          ],
        },
        {
          type: "p",
          children: [
            '"Home sales are projected to rise significantly in each of the next two years as the market steadily returns to normal sales activity," Yun said on Friday. ',
          ],
        },
        {
          type: "p",
          children: [
            "The annual median home price is expected to rise by 1.4% to $395,100 in 2024 and by 2.6% in 2025. ",
          ],
        },
        {
          type: "p",
          children: [
            "With a large increase in apartment construction over the past three years, NAR sees rent growth decelerating in 2024, which it said should help bring consumer price inflation to under 3% this year. The association predicts the Federal Reserve will cut interest rates four times.",
          ],
        },
      ],
    },
    language: "en",
    id: "urn:newsml:mtnewswires.com:20240126:A3065472:0",
    title:
      "December Pending Home Sales Unexpectedly Rise on Annual Basis, Top Views Sequentially",
    provider: "mt-newswires",
