            "Freight railroad Norfolk Southern said in an earnings call that it will be focused on reducing costs and having more disciplined execution of a scheduled network this year. This includes cutting management staff, having longer trains, and possibly having fewer train crews carrying more volumes by the year-end. The Atlanta-based railroad had several disruptions last year and struggled with lower productivity levels. Chief executive Alan Shaw said he wants to improve productivity, including lowering the company's operating ratio--the percentage of revenue consumed by operating costs. Norfolk Southern's 4Q operating ratio at 67.4% is an improvement from 3Q's 74.6%, but it remains highest among its peers. Just two years ago, the railroads were scolded by regulators for having insufficient staff that led to poor service as a result of a relentless focus on efficiency. (esther.fung@wsj.com; @estherfung)",
