    astDescription: {
      type: "root",
      children: [
        {
          type: "p",
          children: [
            "JetBlue Airways ",
            {
              type: "symbol",
              params: {
                symbol: "NASDAQ:JBLU",
                text: "NASDAQ:JBLU",
              },
            },
            " said Friday that it has informed budget rival Spirit Airlines ",
            {
              type: "symbol",
              params: {
                symbol: "NYSE:SAVE",
                text: "NYSE:SAVE",
              },
            },
            ' that their planned merger "may be terminable" as soon as Sunday, as certain closing conditions for the deal may not be satisfied by the agreed-upon deadlines. ',
          ],
        },
        {
          type: "p",
          children: [
            "JetBlue in July 2022 agreed to acquire Spirit in a deal worth $3.8 billion at the time. Last week, a US federal judge blocked the planned merger, saying it would hurt cost-conscious travelers. The companies recently said they have appealed the ruling. ",
          ],
        },
        {
          type: "p",
          children: [
            '"JetBlue continues to evaluate its options under the merger agreement," the company said in a Friday filing with the US Securities and Exchange Commission. "Unless and until such time as the merger agreement is terminated pursuant to its terms, JetBlue will continue to abide by all of its obligations under the merger agreement."',
          ],
        },
        {
          type: "p",
          children: [
            'In response, Spirit said there\'s "no basis for terminating" the deal, according to a separate SEC filing. "Spirit will continue to abide by all of its obligations under the merger agreement, and it expects JetBlue to do the same."',
          ],
        },
        {
          type: "p",
          children: [
            "Spirit shares were down 8.7% in Friday afternoon trade, while JetBlue rose 2.9%. Year-to-date, Spirit shares have plummeted 60%, while JetBlue has dropped 1%. ",
          ],
        },
        {
          type: "p",
          children: [
            'Last Friday, Spirit said its proposed merger with JetBlue remained in "full force and effect." Spirit said at the time it continued to believe that the tie-up was "the best opportunity to increase much-needed competition and choice."',
          ],
        },
        {
          type: "p",
          children: [
            "In March 2023, the US Department of Justice filed an antitrust lawsuit seeking to block the deal on grounds that it will harm competition. JetBlue in July 2023 said it would end its partnership with American Airlines Group ",
            {
              type: "symbol",
              params: {
                symbol: "NASDAQ:AAL",
                text: "NASDAQ:AAL",
              },
            },
            " in the Northeast following a court ruling against the alliance. CNBC reported last Friday that JetBlue was planning to cut back on some routes and services while increasing focus on other areas. ",
          ],
        },
        {
          type: "p",
          children: [
            "Spirit said last Friday that it expected its fourth-quarter revenue to be at the high end of its outlook and that it was evaluating options to refinance its 2025 debt maturities, including $1.1 billion of 8% senior secured notes. ",
          ],
        },
        {
          type: "p",
          children: [
            "The company plans to report its fourth-quarter financial results Feb. 8.",
          ],
        },
      ],
    },
    language: "en",
